package Tree;import Temp.LabelList;import Temp.Temp;import Temp.Label;import java.util.LinkedList;public class JUMP extends Stm {    public Exp1 exp;    public LabelList targets;    public JUMP(Exp1 e, LabelList t) {        exp=e;        targets=t;    }    public JUMP(Label target) {        exp = new NAME(target);        targets = new LabelList(null, null);        targets.head = target;    }    public LinkedList<Exp1> kids() {        LinkedList<Exp1> kids = new LinkedList<Exp1>();        kids.addFirst(exp);        return kids;    }    public Stm build(LinkedList<Exp1> kids) {        return new JUMP(kids.getFirst(), targets);    }    public void accept(IntVisitor v, int d) {        v.visit(this, d);    }    public Temp accept(CodeVisitor v) {        v.visit(this);        return null;    }    public <R> R accept(ResultVisitor<R> v) {        return v.visit(this);    }}